		"text": "2. Na     unidade................................................................ 29  \n6. APOIO INSTITUCIONAL........................................................ 31 \n7. BIBLIOGRAFIA...................................................................... 33 \n* Nota das autoras:  neste material optamos por utilizar pronomes femininos \npara  nos  referir  aos  profissionais  de  saúde,  dado  que  a  maioria  é  do  sexo  \nfeminino. O  mesmo  foi  feito  para  os  autores  de  violência  contra  a  mulher,  \nreferidos pelo pronome masculino. 8 \n \n\n9 \n \nAPRESENTAÇÃO \n \n \nEste         Protocolo         para         \nprofissionais   de   saúde   sobre   \natendimento   a   mulheres   em   \nsituação de violência é fruto de \nmuitos   anos   de   pesquisa,   de   \ndiversos    estudos    publicados    \nsobre  a  violência  de  gênero  e  \nde  experiência  de  intervenção  \nem    serviço    de    saúde    pelas    \nprofessoras   Ana   Flávia   Pires   \nLucas   d’Oliveira   e   Lilia   Blima   \nSchraiber,     e     suas     diversas     \nequipes  de  trabalho,  junto  ao  \ndepartamento     de     Medicina     \nPreventiva    da    Faculdade    de    \nMedicina   da   Universidade   de   \nSão     Paulo. Muitas     dessas     \npesquisas   foram   produto   de   \napoios financeiros    nacionais    \ncomo a Fundação de Amparo a \nPesquisa   do   Estado   de   São   \nPaulo   (FAPESP),   o   Conselho   \nNacional  de  Pesquisa  (CNPq),  \nSecretaria    de    Políticas    para    \nMulheres,     o     Ministério     da     \nSaúde e o Ministério da Justiça. Outras   tantas   contaram   com      \nimportantes       e       generosas       \nparcerias     internacionais,     no     \napoio financeiro, como no caso \nda       Fundação       Ford,       ou       \nenquanto  cooperação  também  \ncientífica,       como       com       a       \nOrganização  Mundial  da  Saúde  \n(OMS), com a London School  \n \n \nof      Hygiene      and            Tropical            \nrecentemente com a Bristol \nUniversity.",
