		"text": "Ameaças de agressão \nDanos propositais ou \nameaças a objetos \npessoais \nDanos ou ameaças a \nanimais de estimação \nDanos ou ameaças a \npessoas queridas \nImpedimento de contato \ncom a família e amigos \nAmeaças a crianças como \nforma de atingir a mulher \nVIOLÊNCIA PSICOLÓGICA \nTapas \nEmpurrões \nChutes \nBofetadas \nTentativa de asfixia \nAmeaça com faca \nTentativa de homicídio \nPuxões de cabelo \nBeliscões \nMordidas \nQueimaduras \nVIOLÊNCIA FÍSICA \n\n3 \n \nVIOLÊNCIA SEXUAL \n \nPráticas        sexuais        não        \nconsentidas,    que    podem    \nse  manifestar  de  diversas  \nmaneiras: \nExpressões verbais ou \ncorporais que não são do \nagrado da pessoa \nEstupro conjugal ou por \nparceiro \nForçar sexo  sem \ncontracepção e proteção \ncontra ISTs \nToques não desejados \nExibicionismo e \nvoyeurismo \nExploração sexual \nParticipação forçada em \npornografia \nVIOLÊNCIA PATRIMONIAL \n \nOcultar, roubar ou \ndanificar: \n \nDinheiro \nObjetos \nDocumentos \nPertences em geral da \nmulher \nCriar dívida em nome da \nmulher \nVIOLÊNCIA MORAL \n \n \nQualquer conduta que \nconfigure calúnia, \ndifamação ou injúria; \nconduta com o objetivo \nde prejudicar a imagem \nda mulher no espaço \npúblico (trabalho, bairro, \namigos, etc). 4 \n \n \nProfissionais de saúde estão em posição privilegiada para detectar \nestes  casos,  pois  as  mulheres  são  as  principais  usuárias  de  serviços  de  \nsaúde  (especialmente  de  atenção  primária)  e  mulheres  em  situação  de  \nviolência,  mesmo  que  não  a  revelem,  tendem  a  usar  os  serviços  com  \nmaior  frequência  do  que  as  que  não  estão  ou  nunca  estiveram  nesta  \nsituação. A  prevalência  da  situação  de  violência  por  parceiro  íntimo  é  \nelevada,  podendo  ser  estimada  como  acometendo  cerca  de  30%  das  \nmulheres.",
