		"text": "Alguns  \nsinais e sintomas podem despertar suspeita e facilitar a identificação dos \ncasos, tais como: \nSaúde mental \n Estresse, ansiedade, depressão, ideação suicida \n Comportamentos auto prejudiciais: abuso de álcool e drogas \n Insônia, transtorno de estresse pós traumático, síndrome do pânico  \n Problemas emocionais e comportamentais das crianças \n \nSaúde sexual e reprodutiva \n Lesões repetidas ou  mal explicadas \n ISTs de repetição e HIV \n Gestações não desejadas \n Dor pélvica, dor durante o ato sexual e demais problemas   sexuais \n Infecções urinárias de repetição \n Atraso no início ou não realização do pré‐natal \n \nQueixas gerais \n Dores crônicas: gastrointestinais, cefaleias \n Consultas repetidas sem diagnóstico claro \n Parceiro intrusivo nas consultas \n Falta constante à própria consulta e das crianças \n\n6 \n \nSe   não   forem   abordados   de   forma   integrada,   os   processos   \npatológicos    que    surgem    associados    à    violência    e    ao    sofrimento    \npsicoemocional  resultam  em  casos  de  difícil  solução,  mesmo  quando  se  \ntrata  de  patologias  mais  simples  e  bem  conhecidas. Esses  casos  estão  \nsujeitos a iatrogenias e tornam‐se frustrantes para as profissionais. Homens  também  podem  ser  vítimas  de  violência  física  e  sexual  por  \nparceiros  ou  parceiras. Entretanto,  em  geral  as  mulheres  vivem  mais  \nsituações de violência sexual, além de violência física mais severa, e estão \nsujeitas  a  um  maior  controle  por  parceiros  homens. Muitos  princípios  da  \nabordagem  para  violência  contra  a  mulher  são  aplicáveis  em  casos  de  \nviolência  contra  homens  e  meninos,  e  para  casos  de  violência  contra  a  \nmulher perpetrada por outros membros da família. Por que a mulher não conta o que está acontecendo?",
