		"text": "Nunca  pergunte  a  \nrespeito de violência se a mulher estiver acompanhada, em especial de \ncrianças  a  partir  de  dois  anos  de  idade. A  companhia  de  outra  mulher  \ntambém não é garantia de segurança. A  abordagem  pode  ser  feita  de  maneira  direta  ou  indireta,  \nsem prejuízo, desde que você não deixe de perguntar e saiba avaliar o \nque parece mais pertinente no  atendimento. Ainda  que  ela  negue  falar  a  respeito  da  situação  de  \nviolência  e  você  mantenha  a  suspeita,  não  a  pressione. A  \nabordagem   inicial   já   indica   à   mulher   que   há   abertura   do   \nserviço   e   interesse   em   acolhê‐la,   caso   ela   queira   falar   de   \nalguma  situação  posteriormente. A  profissional  pode  agendar  \num retorno próximo para manter a oportunidade aberta. 9 \n \n2. 1. Perguntando diretamente em qualquer situação de violência \nPerguntas possíveis: \n“Como você deve saber, hoje em dia não é raro escutarmos sobre pessoas \nque foram agredidas ou sofreram abusos psicológicos e/ou sexuais ao longo \nde suas vidas, e sabemos que isto pode afetar a saúde mesmo anos mais \ntarde. Isto aconteceu alguma vez com você?” “Já vi problemas como o seu\n em pessoas que são fisicamente agredidas. Isto \naconteceu com você?” “Alguém bate em você?” “Você já foi forçada a ter relações sexuais com alguém?” “Alguém insulta ou desrespeita você?” “Alguém tenta controlar você, por exemplo, não permitindo que saia de \ncasa, faça ligações telefônicas ou tenha acesso a dinheiro?” 2. 2. Perguntando indiretamente diante de suspeita de violência              \n         doméstica ou familiar  \nPerguntas possíveis: \n“Está tudo bem em sua casa, com seu companheiro?” “Você está com problemas no relacionamento familiar?” “Você acha que os problemas em casa estão afetando sua saúde?” “Você e seu marido (ou filho, ou pai, ou familiar) brigam muito?”",
