		"text": "O QUE NÃO FAZER \nSeja paciente e calma. Demonstre que você \nesta ouvindo, preste \natenção, mantenha \ncontato visual. O QUE FAZER \nNão pressione a \nusuária a contar sua \nhistoria. Não olhe para seu \nrelógio ou fale muito \nrápido. Não atenda ao \ntelefone e nem fique \nescrevendo ou \nolhando para o \ncomputador. O QUE NÃO FAZER \n\n15 \n \nO QUE DIZER \nDeixe‐a dizer o que \nquer. Pergunte: “como \npodemos ajudá‐la?” Encoraje‐a a continuar \nfalando e pergunte: \n“você gostaria de me \nfalar mais a respeito?” O QUE FAZER \nNão assuma que você \nsabe o que é melhor \npara ela. Não a interrompa. Espere‐a terminar de \nfalar antes de fazer \nperguntas. O QUE NÃO FAZER \n3. 2. Realizando a avaliação de risco e o plano de segurança  \n \nNo   momento   da   detecção,   após   o   acolhimento   inicial   e   \nconhecimento  do  tipo  de  violência  sofrida  pela  usuária,  é  necessário  \navaliar o risco a que está submetida, para saber se o caso é de urgência e \nprecisa  de  assistência  imediata  ou  se  é  possível  à  usuária  aguardar  um  \natendimento  agendado. A  seguir,  três  perguntas‐chave  para  avaliar  risco  \nde morte: \n“Seu companheiro tem arma ou fácil acesso?” “Ele ameaça você de morte?” “Você tem medo de voltar para casa?” 16 \n \nSe    a    usuária    responder    afirmativamente    a    qualquer    dessas    \nperguntas,  é  necessário  encaminhá‐la  imediatamente  para  atendimento  \nespecífico  interno  e/ou  Centro  de  Referência,    para  que,  dentre  outras  \nações,  possam  elaborar  um  plano  de  segurança  com  a  usuária,  para  que  \nela  saiba  como  agir  em  um  momento  de  risco. Também  é  necessário  \nverificar se ela se encontra em isolamento social, cárcere privado, se tem \nrede  primária  de  apoio  com  a  qual  possa  contar/acionar  (familiares,  \namigos,  vizinhos),  se  sabe  ler  e  escrever,  se  sabe  caminhar  por  espaços  \npúblicos.",
