		"text": "31 \n \n              6. APOIO INSTITUCIONAL  \nO   compromisso   institucional   é   essencial   para   que   usuárias   e   \nprofissionais  sintam‐se  confiantes  para  falar  sobre  a  violência  e  para  a  \nimplantação deste tipo de assistência. Cabe à gerência apoiar as ações da \nequipe,  para  que  a  comunicação  seja  direta  e  aberta,  permitindo  que  \ncompartilhem  suas  percepções  e  opiniões,  bem  como  experiências,  sem  \ncusto pessoal. A   instituição   pode   desenvolver   protocolos,   fazer   parcerias   e   \nreorganizar  o  espaço. Limitar  o  acesso  a  áreas  restritas  a  profissionais, \ncomo vestiários e refeitórios, pode reforçar a segurança. Os consultórios \ndevem  ter  mobília  sem  partes  afiadas,  de  preferência  fixada  ao  chão,  \ndisposta  de  modo  a  não  isolar  a  profissional  da  saída. Não  deve  haver  \nobstáculos no trajeto de saída. A  recepção  é  também  um  espaço  para  exercício  do  sigilo. As  \nfuncionárias  não  devem  passar  informações  sobre  a  usuária  para  outros  \nque  não  a  mesma  (se  tem  atendimento  agendado,  qual  data,  exames,  \netc). Não devem revelar informações e devem acionar a instituição sobre \ncasos de insistência em obter estas informações. A unidade pode se organizar para que o espaço da UBS emita sinais \nclaros de que é um lugar aberto e preocupado com esta questão, fazendo \nuso   de   cartazes,   folders,   bottons   etc. em   locais   de   fácil   acesso   a   \nmulheres, como os banheiros. É   importante   fortalecer   parcerias   e   fluxos   para   atender   às   \ndemandas  resultantes,  que  não  são  apenas  imediatas. Necessidades  e  \ncondutas  podem  ser  identificadas  buscando‐se  ativamente  acessar  os  \nmedos  e  as  vivências  da  equipe  por  meio,  por  exemplo,  da  realização  de  \nreuniões  e  da  geração  de  dados. É  possível  pensar  com  as  profissionais \nquais  seriam  os  melhores  indicadores  e  como  levantá‐los,  de  forma  a  \ntraçar um perfil da assistência prestada.",
