		"text": "32 \n \nIsso  pode  ajudar  a  avaliar  e  desenvolver  as  estratégias,  bem  como  \ndar uma devolutiva sobre os casos, como, por exemplo: \nnúmero de casos de violência identificados; \nnúmero  de  pessoas  encaminhadas  para  o  atendimento  específico \nda unidade; \nnúmero  de  pessoas  encaminhadas  para  a  rede  de  atendimento  a  \nmulheres em situação de violência; \nnúmero de pessoas atendidas no atendimento específico da unida‐\nde; \nencaminhamentos que realmente chegaram ao serviços da rede; \ntipos  de  violência  encaminhados  (autor  da  violência,  padrão  de  \nagressão); \ncaracterísticas sociodemográficas das mulheres encaminhadas; \nreferências anteriores utilizadas pelas mulheres; \navaliação da mulher e das profissionais sobre o processo e os resul‐\ntados alcançados. A cultura institucional tem parte fundamental na promoção da não \nviolência. A mobilização ativa é crucial, com resposta imediata de não to‐\nlerância  frente  á  violência,  inclusive  entre  profissionais  e  nas  casas. As  \nusuárias devem saber que esta é a postura da unidade – um exemplo é a \nexposição  de  cartazes  de  campanhas  de  conscientização. É  necessário  \ntambém  buscar  respaldo  das  instâncias  hierarquicamente  superiores,  co‐\nmo o órgão interlocutor de violência da área da saúde. 33 \n \n           7. BIBLIOGRAFIA   \nBRASIL. LEI MARIA DA PENHA. Lei nº 11. 340, de 07 de agosto de 2006. BRASIL. Ministério    da    Saúde. Secretaria    de    Atenção    á    Saúde. Departamento   de   Ações   Programáticas   Estratégicas. Prevenção   e   \ntratamento   dos   agravos   resultantes   da   violência   sexual   contra   \nmulheres  e  adolescentes:  norma  técnica. 3ª. ed. Brasília:  Ministério  da  \nSaúde, 2012. D'OLIVEIRA, Ana Flávia Pires Lucas et al. Fatores associados à violência \npor  parceiro  íntimo  em  mulheres  brasileiras. Rev. Saúde  Pública,    São  \nPaulo ,  v. 43, n. 2, p. 299‐311,  Apr. 2009 . ORGANIZAÇÃO        DOS        ESTADOS        AMERICANOS. Comissão        \nInteramericana  de  Direitos  Humanos.",
