		"text": "6 \n \n \n              3. COMO INTERAGIR \n PRINCÍPIOS EXEMPLOS \nFormule as perguntas como \nconvites para falar \n“Do que você gostaria de falar?” Questões abertas, sem \nrespostas do tipo ‘sim’ ou ‘não’, \nencorajam a mulher a falar \n  \n“Como você se sente a respeito \ndisso?” Repita ou reafirme o que foi \ndito para checar a \ncompreensão \n“Você mencionou que se sente \nmuito frustrada.” Explore conforme necessário \n  \n“Você pode me contar mais \nsobre isso?” Peça esclarecimento sobre o \nque não entender \n  \n“Você pode explicar isso de \nnovo, por favor?” Ajude a identificar e expressar \nnecessidades e preocupações \n“Tem mais alguma coisa que \npreocupa você ou de que você \nprecisa?” “Parece que você pode precisar \nde um lugar para ficar.” “Parece que você está \npreocupada com seus filhos.” Resuma o que ela está dizendo \n“Você parece estar dizendo \nque...” 7 \n \nALGUMAS COISAS A EVITAR: \n Não faça perguntas para induzir, como: “Eu imagino que isso \ndeixou você com raiva, não deixou? ” \n Cuidado com as perguntas com “por que?” , como: “Por que \nvocê  fez  isso?” . Elas  podem  soar  acusatórias  ou culpabilizadoras. NO ATENDIMENTO DE REFERÊNCIA NA UNIDADE É IMPORTANTE \nLEVANTAR: \n Qual a trajetória da usuária; \n Quais são suas crenças e opiniões; \n Quais são deus desejos e angústias; \n Qual é a sua rede (relação com a família, em quem confia, com \nquem mora, quem já ajudou, para quem contou);  \n Quais são seus recursos materiais; \n Quais são os serviços que necessita; \n Qual é a maneira mais segura de contatá-la; \n Qual é o risco a que está exposta. 8 \n \n \n \n \nMÈDIO\n \nRISCO\n \nRISCO \nEXTREMO\n \nALTO\n \nRISCO\n \n1. O  autor  da  violência  tem  faca  ou  arma? Ele  tem  facilidade  em \nconseguir uma arma? Ele já usou contra você ou contra outros?",
