		"text": "Ele já usou contra você ou contra outros? O  quadro  a  seguir  foi  adaptado  da  publicação Enfrentando  a \nViolência contra a Mulher, de Barbara Soares (CE- SEC, 2005), e apresenta \nvários exemplos de situações descritas por mulheres que já estão em \nsituação  de  violência  e  que  podem  contribuir  para  a  avaliação,  em \nconjunto com a usuária, sobre o nível de risco que ela está correndo. A \nautora alerta que não se trata de um teste infalível, por isso recomenda \nque  se  confie  também  no  julgamento  de  ambas  sobre  a  situação, \nprofissional e mulher.  Não tem arma \n Ele tem arma, mas nunca me ameaçou com ela. 4. AVALIAÇÃO DE RISCO COM A USUÁRIA  \n \n Ele me ameaçou com uma arma.  Ele já atacou alguém ao menos uma vez com uma arma. 9 \n \n \n \n \nMÈDIO\n \nRISCO\n \nRISCO \nEXTREMO\n \n \n \n \nMÈDIO\n \nRISCO\n \n \n Nunca foi preso.  Tem medo de ser preso. RISCO \nEXTREMO\n \n2. O autor da violência já foi preso? Ele tem medo da policia ou da \njustiça?  A polícia já veio aqui uma vez, mas não fez nada.  Ele já foi preso outras vezes por agressão. A polícia o deixa \nmais agressivo.  Uma vez ele me atacou na frente do juiz. 3. O  autor  da  violência  tentou  controlar  sua  vida  de  outras \nformas como, por exemplo, isolando você de sua família ou de \nseus amigos?  NãoNós .  Ele sempre nota se eu chego mais tarde e é ciumento.  Ele não gosta que meus amigos venham aqui.  Desde que nos mudamos para longe da minha família ele se  \n tornou meu “carcereiro”.  Ele fica doente de ciúme e imagina coisas absurdas.  Ele fica anotando a quilometragem do meu carro. ALTO\n \nRISCO\n \nALTO\n \nRISCO\n \n\n10 \n \n \n \n \nMÈDIO\n \nRISCO\n \nRISCO \nEXTREMO\n \nALTO\n \nRISCO\n \n \n \n \nMÈDIO\n \nRISCO\n \nRISCO \nEXTREMO\n \nALTO\n \nRISCO\n \n4. Ele ameaçou você, caso tentasse deixá-lo?  Ele nunca fez ameaças. Na verdade, ele uma vez me trancou do \nlado de fora e me disse para deixá-lo.  Ele disse que ficaria transtornado se eu algum dia o deixasse. Eu não \nentendi bem o que ele quis dizer  \n Ele disse que eu nunca conseguiria me esconder dele, porque ele me \nrastrearia onde eu fosse.",
